parameters.jsCode:
const item = items[0];
const scenes = item.json.output?.scenes;

if(!scenes) {
  throw new Error('Scenes not found in input data');
}
return Object.entries(scenes).map(([key,value]) => {
  return {
    json:{
      scene: key,
      text: value
    }
  };
});

// Get the first "story Agent" item
const storyAgent = $items('Story writer')[0].json;
// Build the final output
return [
  {
    // Collect all video URLs from previous items and flatten into a single array
    video_urls: items
      .map(item => item.json?.data?.response?.resultUrls || [])
      .flat(),

    // Use storyAgent output or fallback to empty string
    title: storyAgent?.output?.title || '',
    description: storyAgent?.output?.description || ''
  }
];
